INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("マホ", 101001, "空想、ぬいぐるみ集め", "自警団（カォン）", 9, "獣人族", "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", 0, 42, "マホマホ王国のプリンセス", 10, "O", 155, 16, 22, "内田真礼");
