INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("クルミ（クリスマス）", 108501, "観劇、おままごと", "サレンディア救護院", 6, "ヒューマン", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 0, 40, "泣き虫で臆病な守ってあげたい女の子", 9, "B", 150, 12, 9, "植田佳奈");
